import React, { useState } from 'react';
import { View, Image, ImageBackground, StyleSheet, Text, TextInput } from 'react-native';
import { Feather as Icon } from '@expo/vector-icons';
import { RectButton } from 'react-native-gesture-handler';
import { useNavigation } from '@react-navigation/native';
import { Ionicons } from "react-native-vector-icons";

import styles from './estilo';

export default function tPerfilBaba({ route }) {
    
    const navigation = useNavigation();
    const { usuario } = route.params;

    function Voltar() {
        navigation.goBack()
    }

    return (
        <View style={styles.container}>
            <Ionicons
                name="chevron-back"
                size={40}
                color="black"
                onPress={Voltar}    
            />
            <Text style={styles.title}>{usuario.nome}</Text>

            <View style={styles.infoContainer}>
                <Image source={{ uri: usuario.imagem }} style={styles.imgcontainer} />
                <View style={styles.textContainer}>
                    <Text style={styles.text}>Email: {usuario.email}</Text>
                    <Text style={styles.text}>Celular: {usuario.celular}</Text>
                    <Text style={styles.text}>Descrição: {usuario.descricao}</Text>
                </View>
            </View>

            {/* Aqui você pode adicionar mais conteúdo adicional que deseja mostrar na página de detalhes */}

        </View>
    );
}
